const Food = ({food}) => {

    const dots  = async() => {
        var dotss = []
        for(var i = 0 ; i < 120 - food.name.lenght; i ++){
            dots.push('   .   ')
        }
        return dotss
    }
    return(
        <div className = "food">
            <h3>
                {food.name}
                {dots}
                {food.price}
            </h3>
            <h3>
                {food.description}
            </h3>
        </div>
    )
}

export default Food
